import { Typography } from "@mui/material";
import React from "react";

const TodoList = () => {
  return (
    <>
      <div className="Main_div">
        <div className="Center_div">
          <br />
          <Typography>Todo List</Typography>
          <br/>
          
        </div>
      </div>
    </>
  );
};

export default TodoList;
